const defualtState = {
    btnSave: [],
  };


  const btnSave = (state = defualtState, { type, payload }) => {
    switch (type) {
      case "add":
        return { List: [payload,...state.List ] };


      default:
        return state;
    }
  };
  export default btnSave;

  export const changeState = (payload) => {
    return {
      type: "add",
      payload: payload,
    };
  };
